import './navBar.css'
import { Outlet, Link } from 'react-router-dom'

const Pages = (props) => {
    return <li key={props.index}><a href={props.page}><button>{props.page}</button></a></li>
}



const NavBar = (props) => {
    const pages = props.pages

    return (
        <div>
            <nav>
                <ul>
                    {/* {pages.map((page, i) => <Pages page={page} index={i} />)} */}
                    <li><Link to={'/'}>Home</Link></li>
                </ul>
            </nav>
            <Outlet />
        </div>
    )
};

export default NavBar;
